import React from 'react';
import PostForm from '../components/postForm';
import PostCard from '../components/postCard';

const dummy = {
    isLoggedIn: true,
    imagePaths: [],
    mainPosts: [{
        User: {
            id: 1,
            nickname: 'zero',
            content: 'cho'
        }
    }],
}

const Home = () => {
    return (
        <div>
            { dummy.isLoggedIn && <PostForm />}
              { dummy.mainPosts.map((c) => {
                  return(
                      <PostCard key={c}/>
                  )
              })
              }
        </div>
    )
}

export default Home;
